void push(File f) {
  push(f.listFiles(new FileFilter() {

    public boolean accept(File file) {
      return file.isDirectory();
    }
  }));
  push(f.listFiles(new FileFilter() {

    public boolean accept(File file) {
      return file.getName().endsWith(".txt");
    }
  }));
  find();
}

